import React from "react";

const auth = () => {
  return (
    <div className="authentication">
      <div className="inner-auth">
        <h2>Login</h2>
        <form className="auth-form">
          <div className="form-group">
            <label htmlFor="username">Email address</label>
            <input type="text" id="username" />
          </div>
        </form>
      </div>
    </div>
  );
};

export default auth;
